  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Seney National
  Wildlife Refuge outlines Refuge accomplishments from May through August of 1960.
  The report begins by summarizing the weather conditions, habitat conditions, water
  conditions, and food and cover during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
  reptiles, fish, and disease- is also covered. The Refuge development and maintenance
  section discusses physical developments, plantings, collections and receipts, and
  vegetation control. Resource management is outlined; topics include haying and timber
  removal. A progress report on field investigations and applied research is included.
  The public relations section of the report describes recreational uses, Refuge visitors,
  Refuge participation, hunting, and violations. Items of interest, photographs, and
  N-R forms are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
